import React, { Component } from 'react';
import './Contacts.css';
import {contactDetails} from './data';

import { FaMapMarkedAlt } from "react-icons/fa";
import { FaEnvelope } from "react-icons/fa";
import { FaPhone } from "react-icons/fa";
import { FaInfoCircle } from "react-icons/fa";
import { FaUserCircle } from "react-icons/fa";


export default class Contacts extends Component {
    render() {
        const contactLi =contactDetails.details.map(item=>{
            let icon=item.icon;
            return <li className="contactUsLi">`${icon}`<div className="leftLabel">{item.label}</div><div className="labelInfo">{item.data}</div></li>
          })
        return (
            <div id="contactUsDiv">
                <h1>Contact Us</h1>
                <div className="contactUsCard">
                    <ul className="contactUsList">
                        {contactLi}
                    </ul>
                </div>
            </div>
        )
    }
}
